INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES ("2030/12/17 14:59:59", 24, 1, "あたしだって\nやるときはやるよ！", 10040, 0.0, 0, "2020/04/30 12:00:00", 1, 24001, 0.0, 0.0, 102601, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES ("2030/12/17 14:59:59", 24, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 10040, 0.0, 1, "2020/04/30 12:00:00", 1, 24002, 0.0, 0.0, 102601, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES ("2030/12/17 14:59:59", 24, 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 10040, 0.0, 2, "2020/04/30 12:00:00", 1, 24003, 0.0, 0.0, 102601, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES ("2030/12/17 14:59:59", 24, 2, "やったね！\nこれでようやく\nサボれるよ…", 10040, 0.0, 3, "2020/04/30 12:00:00", 2, 24004, 0.0, 0.0, 102601, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES ("2030/12/17 14:59:59", 24, 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 10040, 0.0, 4, "2020/04/30 12:00:00", 1, 24005, 0.0, 0.0, 102601, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES ("2030/12/17 14:59:59", 24, 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 10040, 0.0, 5, "2020/04/30 12:00:00", 2, 24006, 0.0, 0.0, 102601, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES ("2030/12/17 14:59:59", 24, 2, "あたしも意外と\nやるもんでしょ？", 10040, 0.0, 6, "2020/04/30 12:00:00", 2, 24007, 0.0, 0.0, 102601, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES ("2030/12/17 14:59:59", 24, 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 10040, 0.0, 7, "2020/04/30 12:00:00", 4, 24008, 0.0, 0.0, 102601, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES ("2030/12/17 14:59:59", 24, 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 10040, 0.0, 8, "2020/04/30 12:00:00", 4, 24009, 0.0, 0.0, 102601, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES ("2030/12/17 14:59:59", 24, 4, "まじめに\nやったんだけどな…\n悔しいな～", 10040, 0.0, 9, "2020/04/30 12:00:00", 4, 24010, 0.0, 0.0, 102601, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES ("2030/12/17 14:59:59", 24, 4, "やられた…\nねずみって意外と\nてごわいね", 10040, 0.0, 10, "2020/04/30 12:00:00", 4, 24011, 0.0, 0.0, 102601, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES ("2030/12/17 14:59:59", 24, 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 10040, 0.0, 11, "2020/04/30 12:00:00", 4, 24012, 0.0, 0.0, 102601, "リン");
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES ("2030/12/17 14:59:59", 24, 4, "疲れた…\nけど、次こそは\n守り抜くよ…", 10040, 0.0, 12, "2020/04/30 12:00:00", 1, 24013, 0.0, 1.81, 102601, "リン");
